INSERT INTO `helpinfo` VALUES ('1', '0', '什么是行动力奖励活动？', '销售与公司签订《个人销售代理合同》后，除了正常销售提成，还可用行动力兑换奖励。此活动截止日期为：2018年12月31日。', '1', '2018-05-02 19:09:44', '1.000', null);
INSERT INTO `helpinfo` VALUES ('2', '0', '行动力怎么获取？', '销售A每销售一套申亚智能安防锁，销售 A可获得行动力4点；\r\n', '1', '2018-05-03 12:08:07', '2.000', null);
INSERT INTO `helpinfo` VALUES ('3', '0', '行动力奖励是什么？', '1点行动力=30元奖励金额。', '1', '2018-05-03 12:08:31', '3.000', null);
INSERT INTO `helpinfo` VALUES ('4', '0', '行动力的结算时间？', '每月月底结算，到账时间为下一个月10号。（遇到法定节假日顺延）', '1', '2018-05-03 12:08:56', '4.000', null);
INSERT INTO `helpinfo` VALUES ('5', '0', '必须先签合同才能参加奖励活动吗?', '没有签订《个人销售代理合同》的行动力可以保留三个月，在签订之后按结算规则结算奖励。', '1', '2018-05-03 12:09:14', '5.000', null);
