-- ----------------------------
DROP TABLE IF EXISTS `installmaterial`;
CREATE TABLE `installmaterial` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `producecode` varchar(255) DEFAULT NULL COMMENT '生产编码',
  `materialcode` varchar(255) DEFAULT NULL COMMENT '材料编号',
  `materialname` varchar(255) DEFAULT NULL COMMENT '材料名称',
  `batchno` varchar(255) DEFAULT NULL COMMENT '材料批次号',
  `materialidentfy` varchar(255) DEFAULT NULL COMMENT '材料唯一标识(SN/PN)',
  `depotamount` int(255) DEFAULT NULL COMMENT '材料数量',
  `materialstatus` varchar(255) DEFAULT NULL COMMENT '材料状态（0-组装失败；1-组装中；2-组装完成；3-已经入库）',
  `printflag` varchar(255) DEFAULT NULL COMMENT '是否打印条码（0-未打印；1-已打印）',
  `addtime` datetime DEFAULT NULL COMMENT '生产时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of installmaterial
-- ----------------------------

-- ----------------------------
-- Table structure for material
-- ----------------------------
DROP TABLE IF EXISTS `material`;
CREATE TABLE `material` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `materialcode` varchar(255) DEFAULT NULL COMMENT '材料编号',
  `materialname` varchar(255) DEFAULT NULL COMMENT '材料名称',
  `materialunit` varchar(255) DEFAULT NULL COMMENT '材料计算单位',
  `depotamount` int(10) DEFAULT '0' COMMENT '警戒量',
  `materialstatus` varchar(255) DEFAULT NULL COMMENT '材料状态',
  `materialsource` varchar(255) DEFAULT NULL COMMENT '材料来源（0-自产；1-外购）',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_materialcode` (`materialcode`) USING BTREE,
  UNIQUE KEY `unique_materialname` (`materialname`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=128 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of material
-- ----------------------------

-- ----------------------------
-- Table structure for materialbom
-- ----------------------------
DROP TABLE IF EXISTS `materialbom`;
CREATE TABLE `materialbom` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pid` int(10) DEFAULT NULL COMMENT '父节点BOM的ID',
  `materialcode` varchar(255) DEFAULT NULL COMMENT '材料编码',
  `materialname` varchar(255) DEFAULT NULL COMMENT '材料名称',
  `bomcode` varchar(255) DEFAULT NULL COMMENT '规则编号（有规则的编号，方便管理拓扑结构，举例：001，002,001-001等。',
  `componentcode` varchar(255) DEFAULT NULL COMMENT '元器件编号',
  `componentname` varchar(255) DEFAULT NULL COMMENT '封装',
  `componentmodel` varchar(255) DEFAULT NULL COMMENT '规格',
  `amount` int(15) DEFAULT NULL COMMENT '所需数量',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
