-- ----------------------------
-- Records of materialbom
-- ----------------------------

-- ----------------------------
-- Table structure for materialcheck
-- ----------------------------
DROP TABLE IF EXISTS `materialcheck`;
CREATE TABLE `materialcheck` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `materialcode` varchar(255) DEFAULT NULL COMMENT '材料编号',
  `materialname` varchar(255) DEFAULT NULL COMMENT '材料名称',
  `batchno` varchar(255) DEFAULT NULL COMMENT '批次号',
  `materialidentfy` varchar(255) DEFAULT NULL COMMENT '材料唯一标识SN码',
  `checkinfo` varchar(1000) DEFAULT NULL COMMENT '检验信息',
  `repairinfo` varchar(1000) DEFAULT NULL COMMENT '维修信息',
  `checkercode` varchar(255) DEFAULT NULL COMMENT '检验人员编号',
  `checktime` datetime DEFAULT NULL COMMENT '检验时间',
  `checkstatus` varchar(255) DEFAULT NULL COMMENT '测试结果（0-不合格维修；1-合格入库）',
  `hightemp` varchar(255) DEFAULT NULL COMMENT '高温老练(0-不合格；1-合格)',
  `currentvoltage` varchar(255) DEFAULT NULL COMMENT '电流电压是否正常(0-不合格；1-合格)',
  `displayscreen` varchar(255) DEFAULT NULL COMMENT '显示屏是否正常点亮（0-不合格；1-合格）',
  `touchscreen` varchar(255) DEFAULT NULL COMMENT '触屏是否灵敏(0-不合格；1-合格）',
  `messageconnect` varchar(255) DEFAULT NULL COMMENT '通讯是否连接(0-不合格；1-合格)',
  `openclosedoor` varchar(255) DEFAULT NULL COMMENT '开关门是否顺畅(0-不合格；1-合格)',
  `keystrokesound` varchar(255) DEFAULT NULL COMMENT '按键声音是否正常(0-不合格；1-合格）',
  `fingerprint` varchar(255) DEFAULT NULL COMMENT '内外指纹是否灵敏(0-不合格；1-合格)',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='材料检验';

-- ----------------------------
-- Records of materialcheck
-- ----------------------------

