CREATE TABLE `purchase` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `purchasecode` varchar(255) DEFAULT NULL COMMENT '采购单号',
  `supplierid` int(10) DEFAULT NULL COMMENT '供应商ID',
  `suppliername` varchar(255) DEFAULT NULL COMMENT '供应商名称',
  `supplierinfo` varchar(1000) DEFAULT NULL COMMENT '供应商信息',
  `materailmoney` double(15,2) DEFAULT '0.00' COMMENT '材料总费用',
  `deliverymoney` double(15,2) DEFAULT '0.00' COMMENT '快递费用',
  `discountmoney` double(15,2) DEFAULT '0.00' COMMENT '优惠金额',
  `totalmoney` double(15,2) DEFAULT '0.00' COMMENT '总金额',
  `plandelivertime` datetime DEFAULT NULL COMMENT '发货日期',
  `planarrivaltime` datetime DEFAULT NULL COMMENT '到货日期',
  `actualdelivertime` datetime DEFAULT NULL COMMENT '实际发货时间',
  `actualarrivaltime` datetime DEFAULT NULL COMMENT '实际到货时间',
  `status` varchar(255) DEFAULT NULL COMMENT '状态（0-未到货；1-已到货；2-已审核入库）',
  `operatorcode` varchar(255) DEFAULT NULL COMMENT '操作员ID',
  `addtime` datetime DEFAULT NULL COMMENT '采购日期',
  `billtype` varchar(255) DEFAULT NULL COMMENT '票据类型(0-不开票；1-开票)',
  `billstatus` varchar(255) DEFAULT NULL COMMENT '票据状态(0-票据未到；1-票据已到)',
  `invoicecode` varchar(255) DEFAULT NULL COMMENT '票据号码',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of purchase
-- ----------------------------

