-- ----------------------------
-- Table structure for userorder
-- ----------------------------
DROP TABLE IF EXISTS `userorder`;
CREATE TABLE `userorder` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `ordercode` varchar(255) DEFAULT NULL COMMENT '订单号',
  `usercode` varchar(255) DEFAULT NULL COMMENT '订户编号',
  `username` varchar(255) DEFAULT NULL COMMENT '客户姓名',
  `usersex` varchar(255) DEFAULT NULL COMMENT '客户性别(0-女；1-男)',
  `phone` varchar(255) DEFAULT NULL COMMENT '联系电话',
  `address` varchar(255) DEFAULT NULL COMMENT '安装地址',
  `source` varchar(255) DEFAULT NULL COMMENT '客户来源（0-销售APP；1-400客服；2-小区驻点）',
  `visittype` varchar(255) DEFAULT NULL COMMENT '上门类型（0.公司派人推销测量，1.销售员亲自推销测量; 2-已推销，公司派人只需测量）',
  `salercode` varchar(255) DEFAULT NULL COMMENT '销售员编号',
  `talkercode` varchar(255) DEFAULT NULL COMMENT '讲解员编号',
  `visitorcode` varchar(255) DEFAULT NULL COMMENT '上门人员',
  `visitorstatus` varchar(255) DEFAULT NULL COMMENT '是否已派任务单(0-否；1-已派）',
  `productfee` int(15) DEFAULT '0' COMMENT '产品费用',
  `otherfee` int(15) DEFAULT '0' COMMENT '其他费用',
  `gaintotalmoney` int(15) DEFAULT '0' COMMENT '获取提成的总金额',
  `totalmoney` int(15) DEFAULT '0' COMMENT '总金额',
  `discountfee` int(15) DEFAULT '0' COMMENT '折扣费',
  `firstpayment` int(15) DEFAULT '0' COMMENT '首付金额',
  `firstarrivalflag` varchar(255) DEFAULT NULL COMMENT '首付款到账标识（0-未支付；1-已支付 ；2-确认到账）',
  `finalpayment` int(15) DEFAULT '0' COMMENT '尾款金额',
  `finalarrivalflag` varchar(255) DEFAULT NULL COMMENT '尾款到账标识（0-未支付；1-已支付 ；2-确认到账）',
  `paytype` varchar(255) DEFAULT '0' COMMENT '支付类型(0-支付定金；1-货到付款)',
  `addtime` datetime DEFAULT NULL COMMENT '添加时间',
  `status` varchar(255) DEFAULT NULL COMMENT '状态（0-新生成订单; 1-已打包; 2-已发货；3-已派工；4-派工接收；5-安装完成；6-审核结单；10-安装失败；21-订单取消）',
  `operatetime` datetime DEFAULT NULL COMMENT '操作时间',
  `filingflag` varchar(255) DEFAULT '0' COMMENT '是否归档（0-未归档；1-已归档）',
  `installercode` varchar(255) DEFAULT NULL COMMENT '安装人编号',
  `stationcode` varchar(255) DEFAULT NULL COMMENT '驻点编号',
  `lockcoreflag` varchar(255) DEFAULT NULL COMMENT '是否带机械锁芯(0-无；1-有)',
  `productcolor` varchar(255) DEFAULT NULL COMMENT '产品颜色编码(0101-摩卡棕；0102-石英灰；0103-香槟金)',
  `visitorflag` varchar(255) DEFAULT '0' COMMENT '是否需要派测量(0-不需要；1-需要)',
  `productconfirm` varchar(255) DEFAULT '0' COMMENT '产品是否确认完成（0-未确认；1-已经确认）',
  `modelcode` varchar(255) DEFAULT NULL COMMENT '产品型号编码',
  `modelname` varchar(255) DEFAULT NULL COMMENT '产品型号名称',
  `discountgain` int(10) DEFAULT NULL COMMENT '优惠权限',
  `fixedgain` int(10) DEFAULT NULL COMMENT '固定返利',
  `managergain` int(10) DEFAULT NULL COMMENT '销售管家提成',
  `managercode` varchar(255) DEFAULT NULL COMMENT '销售管家编号',
  `orderinfo` varchar(255) DEFAULT NULL COMMENT '订单详情',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8;

